export const requestParks = () => ({
    type: 'REQUEST_PARKS',
})
export const retrieveParks = (data) => ({
    type: 'RETRIEVE_PARKS',
    data
})
export const retrieveParksError = () => ({
    type: 'RETRIEVE_PARKS_ERROR',
})

export const selectPark = (park) => ({
    type: 'SELECTED_PARK',
    park
})
